additional_resources: []
comment: 'Multiplicities of charged unidentified hadrons produced in semi-inclusive
  deep-inelastic scattering were measured in bins of the Bjorken scaling variable
  $x$, the photon virtuality, the relative hadron energy $z$ and the hadron transverse
  momentum $P_{hT}$. Data were collected by the COMPASS Collaboration using a $160$
  GeV muon beam and an isoscalar target ($^{6}$LiD). The following kinematic domain
  is covered by the data: photon virtuality $Q^{2}$ $>$ $1$ (GeV/$c$)$^{2}$, invariant
  mass of the hadronic system $W$ $>$ $5$ GeV/$c^{2}$, Bjorken scaling variable in
  the range $0.003 < x <0.4$, fraction of the virtual photon energy carried by the
  hadron in the range $0.2 < z < 0.8$, square of the hadron transverse momentum with
  respect to the virtual photon direction in the range $0.02$ (GeV/$c$)$^2$ $< P_{hT}^{2}$
  $<$ $3$ (GeV/$c$)$^{2}$.'
